import React from 'react';

const ColoredLineWhite = (
    <hr
        style={{
            color: "white",
            height: 0.5,
            width: 100
        }}
    />
);

const ColoredLineBlack = ({ color }) => (
    <hr
        style={{
            color: color,
            backgroundColor: color,
            height: 0.5,
            width: 800
        }}
    />
);

export default ColoredLineWhite;
